// components/SkillsPage.js

import React from 'react';
import './SkillsPage.css'; // Create SkillsPage.css for styling
import SkillTile from './SkillTile'; // Assuming you have a SkillTile component

const SkillsPage = () => {
  const skills = [
    { name: 'HTML', imagePath: '/assets/html.png' },
    { name: 'CSS', imagePath: '/assets/css.png' },
    { name: 'JavaScript', imagePath: '/assets/javascript.png' },
    { name: 'React', imagePath: '/assets/react.png' },
    { name: 'Bash', imagePath: '/assets/bash.png' },
  ];

  return (
    <section id="skills" className="section skills-section">
      <h1 className="section-heading">Skills</h1>
      <div className="skill-list">
        {skills.map((skill, index) => (
          <SkillTile key={index} skill={skill} />
        ))}
      </div>
    </section>
  );
};

export default SkillsPage;
